import React from 'react';

class List extends React.Component {
  constructor(props) {
    super(props);
    this.state
  }

  render() {
    return (
      <ul>
        {this.props.tasks.map((item, i) => {
          return <li key={i}>{item.name}
            <button>Delete</button>
          </li>
        })}
      </ul>
    )
  }
}

export default List;
